import{_ as e,c as o,o as i,ah as n,bF as r,bi as s,bG as a,bH as l}from"./chunks/framework.0CRElgwM.js";const u=JSON.parse('{"title":"Settings","description":"","frontmatter":{"prev":{"text":"Icon","link":"/documentation/icon"},"next":{"text":"Log","link":"/documentation/log"}},"headers":[],"relativePath":"documentation/settings.md","filePath":"documentation/settings.md","lastUpdated":1758109585000}'),d={name:"documentation/settings.md"};function c(h,t,g,p,m,f){return i(),o("div",null,[...t[0]||(t[0]=[n('<h1 id="settings" tabindex="-1">Settings <a class="header-anchor" href="#settings" aria-label="Permalink to ‚ÄúSettings‚Äù">‚Äã</a></h1><p>The Settings page provides comprehensive control over the Excellent Data Filler extension&#39;s behavior, allowing you to customize its functionality according to your specific needs and preferences.</p><img src="'+r+'" width="500" height="500" alt="Extension Settings Interface"><h2 id="extension-settings" tabindex="-1">üîß Extension Settings <a class="header-anchor" href="#extension-settings" aria-label="Permalink to ‚Äúüîß Extension Settings‚Äù">‚Äã</a></h2><p>Core extension controls that determine the overall behavior and functionality of the extension.</p><h3 id="extension-status" tabindex="-1">üîÑ Extension Status <a class="header-anchor" href="#extension-status" aria-label="Permalink to ‚ÄúüîÑ Extension Status‚Äù">‚Äã</a></h3><p>Control the main power state of the extension with this essential setting.</p><p><strong>Functionality:</strong></p><ul><li><strong>Turn ON/OFF</strong>: Enable or disable the entire extension</li><li><strong>Keyboard Shortcut</strong>: Use <code>ALT + Q</code> to quickly toggle extension status</li><li><strong>Visual Feedback</strong>: Icon changes color based on status (colored = ON, grayed = OFF)</li></ul><p><strong>How to Use:</strong></p><ol><li>Click the extension icon in your browser toolbar</li><li>Toggle the &quot;Extension is ON&quot; switch</li><li>Extension status changes immediately</li><li>All automation features respect this setting</li></ol><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p>Change Shortcuts Key in Chrome - <code>chrome://extensions/shortcuts</code></p></div><hr><h2 id="dialog-boxes" tabindex="-1">üí¨ Dialog Boxes <a class="header-anchor" href="#dialog-boxes" aria-label="Permalink to ‚Äúüí¨ Dialog Boxes‚Äù">‚Äã</a></h2><p>Configure how the extension handles browser dialogs and alerts to ensure smooth automation without interruptions.</p><p><strong>Supported Dialog Types:</strong></p><ul><li><strong>Alert Dialog</strong>: Simple alert messages</li><li><strong>Confirm Dialog</strong>: Yes/No confirmation prompts</li></ul><h3 id="alert-dialog-handling" tabindex="-1">üö® Alert Dialog Handling <a class="header-anchor" href="#alert-dialog-handling" aria-label="Permalink to ‚Äúüö® Alert Dialog Handling‚Äù">‚Äã</a></h3><p>Automatically handle alert messages during form filling.</p><p><strong>Look like this:</strong></p><img src="'+s+'" alt="Alert Dialog Handling"><p><strong>Settings:</strong></p><ul><li><strong>Toggle Switch</strong>: Turn Alert Dialog Handling ON/OFF</li><li><strong>Site URL Input</strong>: Enter website URL to hide alert dialogs</li></ul><p><strong>How to Use:</strong></p><ol><li>Toggle the switch to <strong>ON</strong></li><li>Enter the website URL in the input field and press <code>enter</code></li><li>Extension will automatically dismiss alert dialogs on the specified site</li></ol><div class="info custom-block"><p class="custom-block-title">Note</p><p>If when you fill entry, your entry complete has been detected by the alert message, then you can turn on this option as well as give the URL of the site.</p></div><div class="info custom-block"><p class="custom-block-title">Note</p><p>Press <code>enter</code> to save the website URL</p></div><h3 id="confirm-dialog-handling" tabindex="-1">‚úÖ Confirm Dialog Handling <a class="header-anchor" href="#confirm-dialog-handling" aria-label="Permalink to ‚Äú‚úÖ Confirm Dialog Handling‚Äù">‚Äã</a></h3><p>Automatically respond to confirmation dialogs.</p><p><strong>Look like this:</strong></p><img src="'+a+'" height="400" width="400" alt="Confirm Dialog Handling"><p><strong>Settings:</strong></p><ul><li><strong>Toggle Switch</strong>: Turn Confirm Dialog Handling ON/OFF</li><li><strong>Site URL Input</strong>: Enter website URL for confirm dialog handling</li><li><strong>Message Text Input</strong>: (Optional) Enter specific confirm dialog message text</li></ul><p><strong>How to Use:</strong></p><ol><li>Toggle the switch to <strong>ON</strong></li><li>Enter the website URL in the input field and press <code>enter</code></li><li>(Optional) Enter specific confirm dialog message text</li><li>Extension will automatically handle confirm dialogs on the specified site</li></ol><div class="info custom-block"><p class="custom-block-title">Important Note</p><p>If you do not give the message of Confirm Dialog then the extension will ok all the confirm dialogs of the site.</p></div><div class="info custom-block"><p class="custom-block-title">Note</p><p>If when you fill entry, your entry complete has been detected by the confirm message, then you can turn on this option as well as give the URL of the site.</p></div><hr><h2 id="insert-site-form" tabindex="-1">‚ûï Insert Site/Form <a class="header-anchor" href="#insert-site-form" aria-label="Permalink to ‚Äú‚ûï Insert Site/Form‚Äù">‚Äã</a></h2><p>Configure how the extension detects, processes, and handles form elements on websites for optimal automation performance.</p><h3 id="form-detection" tabindex="-1">üîç Form Detection <a class="header-anchor" href="#form-detection" aria-label="Permalink to ‚Äúüîç Form Detection‚Äù">‚Äã</a></h3><p>Configure form element detection and processing.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Form Element Label Position</strong></td><td>Position value for form element labels</td><td><code>1</code>, <code>2</code>, <code>3</code>, ..</td></tr><tr><td><strong>Ignore HTML Element Tag</strong></td><td>HTML elements to ignore during form detection</td><td><code>div</code>, <code>span</code>, <code>script</code></td></tr><tr><td><strong>Ignore Input Tag Type</strong></td><td>Input types to ignore during automation</td><td><code>hidden</code>, <code>reset</code>, <code>button</code></td></tr><tr><td><strong>Generate Selector Query Method</strong></td><td>Method for generating element selectors</td><td><strong>Unique Path</strong> <br> <strong>Full Path (CSS)</strong> <br> <strong>Full Path (DIV)</strong> <br> <strong>XPath</strong></td></tr></tbody></table><h3 id="advanced-options" tabindex="-1">‚öôÔ∏è Advanced Options <a class="header-anchor" href="#advanced-options" aria-label="Permalink to ‚Äú‚öôÔ∏è Advanced Options‚Äù">‚Äã</a></h3><p>Fine-tune form detection behavior with advanced configuration options.</p><table tabindex="0"><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><strong>Fetch all the form fields of the site</strong></td><td>Detect fields both inside and outside forms</td></tr><tr><td><strong>Check External Library in the Page</strong></td><td>Check for external libraries on the page</td></tr><tr><td><strong>Fetch only visible forms</strong></td><td>Detect only visible forms for better performance</td></tr><tr><td><strong>Fetch only visible form fields</strong></td><td>Detect only visible form fields</td></tr><tr><td><strong>Allow Right Click on Site</strong></td><td>Enable right-click functionality on the site</td></tr><tr><td><strong>FORCE: Allow Right Click on Site</strong></td><td>Force enable right-click functionality</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Note</p><p>If some fields in your site are inside the form and some fields are outside the form, then use the <strong>&quot;Fetch all the form fields of the site&quot;</strong> option.</p></div><h3 id="field-name-cleaning" tabindex="-1">üßπ Field Name Cleaning <a class="header-anchor" href="#field-name-cleaning" aria-label="Permalink to ‚Äúüßπ Field Name Cleaning‚Äù">‚Äã</a></h3><p>Clean and format field names automatically for better organization and readability.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Is Clean Field Name</strong></td><td>Toggle to remove repeated words from field names</td><td><code>ON</code></td></tr><tr><td><strong>Remove String From Field Name</strong></td><td>Strings to remove from field names</td><td><code>ctl00$ContentPlaceHolder1$</code>, <code>ctl00$OnlineContent$</code></td></tr><tr><td><strong>Remove String From Field Prefix</strong></td><td>Prefix strings to remove from field names</td><td><code>aspnetForm$</code>, <code>form1$</code></td></tr></tbody></table><p><strong>Example:</strong></p><ul><li><strong>Original</strong>: <code>ctl00$ContentPlaceHolder1$txtName</code></li><li><strong>After Cleaning</strong>: <code>txtName</code></li></ul><hr><h2 id="form-filler" tabindex="-1">üìÉ Form Filler <a class="header-anchor" href="#form-filler" aria-label="Permalink to ‚ÄúüìÉ Form Filler‚Äù">‚Äã</a></h2><p>Configure visual feedback, performance settings, and form filling behavior for optimal user experience.</p><h3 id="visual-feedback" tabindex="-1">üëÅÔ∏è Visual Feedback <a class="header-anchor" href="#visual-feedback" aria-label="Permalink to ‚ÄúüëÅÔ∏è Visual Feedback‚Äù">‚Äã</a></h3><p>Configure visual indicators during form filling.</p><table tabindex="0"><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><strong>Show Response Color in Field</strong></td><td>Display response color in fields while filling forms</td></tr><tr><td><strong>Show Entry&#39;s Status Bar</strong></td><td>Display status bar showing entry progress</td></tr></tbody></table><p><strong>Look like this: Status Bar</strong></p><img src="'+l+'" alt="Image"><div class="info custom-block"><p class="custom-block-title custom-block-title-default">INFO</p><p>If click <code>Mark as Saved</code> button on the status bar then execute <code>{MARK AS SAVED}</code> segment. If segment exists then execute.</p></div><h3 id="performance-settings" tabindex="-1">‚ö° Performance Settings <a class="header-anchor" href="#performance-settings" aria-label="Permalink to ‚Äú‚ö° Performance Settings‚Äù">‚Äã</a></h3><p>Configure filling speed and monitoring behavior.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Status Bar Position</strong></td><td>Position of the status bar on the page</td><td><strong>Bottom</strong> <br> <strong>Top</strong></td></tr><tr><td><strong>Types of URL Monitoring</strong></td><td>Method for monitoring URL changes</td><td><strong>- When the page is not reloaded when the URL changes.</strong> <br> <strong>- When the page is not reloaded when the URL changes. (ASYNC METHOD)</strong> <br> <strong>- When the page is reloaded when the URL changes.</strong></td></tr><tr><td><strong>Types of Form Filling Speed</strong></td><td>Speed of form filling operations</td><td><strong>Fast (no delay)</strong> <br> <strong>Medium (0.3s delay)</strong> <br> <strong>Slow (2s delay)</strong> <br> <strong>Random (min, max)</strong></td></tr></tbody></table><h4 id="random-speed-settings" tabindex="-1">üé≤ Random Speed Settings <a class="header-anchor" href="#random-speed-settings" aria-label="Permalink to ‚Äúüé≤ Random Speed Settings‚Äù">‚Äã</a></h4><p>Configure random delay parameters when &quot;Random (min, max)&quot; is selected.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Minimum Milliseconds</strong></td><td>Minimum delay time in milliseconds</td><td><code>100</code>, <code>500</code>, <code>1000</code></td></tr><tr><td><strong>Maximum Milliseconds</strong></td><td>Maximum delay time in milliseconds</td><td><code>2000</code>, <code>3000</code>, <code>5000</code></td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Note</p><p>These settings only appear when &quot;Random (min, max)&quot; is selected for Form Filling Speed.</p></div><h3 id="web-request-monitoring" tabindex="-1">üåê Web Request Monitoring <a class="header-anchor" href="#web-request-monitoring" aria-label="Permalink to ‚Äúüåê Web Request Monitoring‚Äù">‚Äã</a></h3><p>Monitor specific URL patterns for web requests.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>URL Patterns</strong></td><td>List of URL patterns to monitor</td><td><code>https://*/*</code> <br> <code>*://mail.google.com/*</code> <br> <code>*://example.com/*</code></td></tr></tbody></table><p><strong>How to Use:</strong></p><ol><li>Enter URL patterns in the input field</li><li>Press <code>Enter</code> to add each pattern</li><li>Patterns will be displayed as tags</li><li>Use wildcards (<code>*</code>) for flexible matching</li></ol><div class="info custom-block"><p class="custom-block-title">Note</p><p>if use <a href="/documentation/field-types/web-request-completed.html"><code>Web Request Completed</code></a> field type, then you have to use the URL patterns in the <strong>Request URL</strong> field.</p></div><h3 id="environment-settings" tabindex="-1">‚öôÔ∏è Environment Settings <a class="header-anchor" href="#environment-settings" aria-label="Permalink to ‚Äú‚öôÔ∏è Environment Settings‚Äù">‚Äã</a></h3><p>Configure environment settings for the extension.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Environment Variables</strong></td><td>JSON configuration for environment settings</td><td><pre>{&quot;title&quot;: &quot;EDF&quot;, &quot;version&quot;: &quot;4.0&quot;}</pre></td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">How to Use</p><p>Use in the field options value or field value with <code>{$variable_name$}</code>. Like this:</p><div class="language-json"><button title="Copy Code" class="copy"></button><span class="lang">json</span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">{</span><span style="--shiki-light:#B31D28;--shiki-light-font-style:italic;--shiki-dark:#FDAEB7;--shiki-dark-font-style:italic;">$title$</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span></code></pre></div></div><hr><h2 id="microsoft-form" tabindex="-1">üè¢ Microsoft Form <a class="header-anchor" href="#microsoft-form" aria-label="Permalink to ‚Äúüè¢ Microsoft Form‚Äù">‚Äã</a></h2><p>Configure Microsoft Forms integration and field selector customization for optimal compatibility.</p><table tabindex="0"><thead><tr><th>Field Options</th><th>Description</th><th>Example Values</th></tr></thead><tbody><tr><td><strong>Import Settings</strong></td><td>Import Microsoft Form configuration</td><td>JSON configuration file</td></tr><tr><td><strong>Export Settings</strong></td><td>Export current Microsoft Form settings</td><td>Downloadable settings file</td></tr><tr><td><strong>Custom Selector Query</strong></td><td>Override default field selectors when they don&#39;t work</td><td><code>input[name=&quot;fieldName&quot;]</code>, <code>#customField</code></td></tr></tbody></table><p><strong>How to Use:</strong></p><ol><li><strong>Import Settings</strong>: Upload a previously exported Microsoft Form configuration</li><li><strong>Export Settings</strong>: Download current settings for backup or sharing</li><li><strong>Custom Selector Query</strong>: Enter custom CSS selectors for problematic fields</li></ol><hr><h2 id="export-import" tabindex="-1">üì§ Export/Import <a class="header-anchor" href="#export-import" aria-label="Permalink to ‚Äúüì§ Export/Import‚Äù">‚Äã</a></h2><p>Manage data backup, restoration, and site management operations.</p><h3 id="import-operations" tabindex="-1">üì• Import Operations <a class="header-anchor" href="#import-operations" aria-label="Permalink to ‚Äúüì• Import Operations‚Äù">‚Äã</a></h3><table tabindex="0"><thead><tr><th>Operation</th><th>Description</th><th>File Format</th></tr></thead><tbody><tr><td><strong>Import Data</strong></td><td>Import previously exported site data and configurations</td><td>JSON</td></tr></tbody></table><h3 id="export-operations" tabindex="-1">üì§ Export Operations <a class="header-anchor" href="#export-operations" aria-label="Permalink to ‚Äúüì§ Export Operations‚Äù">‚Äã</a></h3><table tabindex="0"><thead><tr><th>Operation</th><th>Description</th><th>Includes</th></tr></thead><tbody><tr><td><strong>Backup All Sites</strong></td><td>Export all active sites and their configurations</td><td>Forms, fields, settings</td></tr><tr><td><strong>Backup Archived Sites</strong></td><td>Export only archived/inactive sites</td><td>Archived forms and configurations</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Note</p><p>Export option don&#39;t include excel data.</p></div><h3 id="delete-operations" tabindex="-1">üóëÔ∏è Delete Operations <a class="header-anchor" href="#delete-operations" aria-label="Permalink to ‚ÄúüóëÔ∏è Delete Operations‚Äù">‚Äã</a></h3><table tabindex="0"><thead><tr><th>Operation</th><th>Description</th><th>Impact</th></tr></thead><tbody><tr><td><strong>Delete All Sites</strong></td><td>Permanently remove all sites and their data</td><td><strong>‚ö†Ô∏è Irreversible - All data will be lost</strong></td></tr><tr><td><strong>Delete Archived Sites</strong></td><td>Permanently remove only archived sites</td><td><strong>‚ö†Ô∏è Irreversible - Archived data will be lost</strong></td></tr></tbody></table><div class="warning custom-block"><p class="custom-block-title">Important</p><ul><li><strong>Backup before deleting</strong>: Always create a backup before performing delete operations</li><li><strong>Irreversible action</strong>: Deleted data cannot be recovered</li><li><strong>Archive instead of delete</strong>: Consider archiving sites instead of deleting them</li></ul></div>',95)])])}const x=e(d,[["render",c]]);export{u as __pageData,x as default};
